$().ready(function() {
  if (window.matchMedia('(max-width: 767px)').matches) {
    $('.video').append('<source id="video-src" src="" type="video/mp4">');
  } else {
    $('.video').append('<source id="video-src" src="video/video-slivkimedia.mp4" type="video/mp4">');
  }
});

$('document').ready(function() {
  $('form').submit(function(e) {
    var ref = $(this).find("[required]");
    $(ref).each(function() {
      if ($(this).val() == '') {
        $(this).focus();
        e.preventDefault();
        return false;
      }
    });
    return true;
  });
});


function pulseRound(){
  $.each($('.c1-s5-puls-center'), function(i, el) {
    var timeOutId = setTimeout(function() {
      $('.c1-s5-puls-center').removeClass('c1-s5-puls-center-active')
      $(el).addClass('c1-s5-puls-center-active');
    }, 500 + (i * 3000));
  });
}

$(function() {
pulseRound();
  var intervalId = setInterval(function() {
    pulseRound();
  }, 36000);
});

